import React from 'react';
import SpotifyPlaylistButtons from './SpotifyPlaylistButtons';


const Compospoty = () => {
  const playlists = [
    { name: 'Playlist 1', link: 'https://open.spotify.com/playlist/playlist-1' },
    { name: 'Playlist 2', link: 'https://open.spotify.com/playlist/playlist-2' },
    { name: 'Playlist 3', link: 'https://open.spotify.com/playlist/playlist-3' },
  ];

  return (
    <div>
      <h1>Mis playlists de Spotify</h1>
      <SpotifyPlaylistButtons playlists={playlists} />
    </div>
  );
};

export default Compospoty;
